$(".selected").click(function(){this.checked?$(this).closest("tr").find(".client").removeAttr("disabled"):$(this).closest("tr").find(".client").attr("disabled","")});$("#save-warehouses").click(function(n){n.preventDefault();var t=[];$(".selected:checked").each(function(){var i=$(this).closest("table").data("name"),n=$(this).closest("tr"),r=n.data("code"),u=n.data("name"),f=n.data("id"),e=n.find(".client").prop("checked");t.push({Id:f,Code:r,Name:u,Subsidiary:i,ClientVisible:e})});$.post(urlEdit,{items:t},function(n){n.message===""?showMessage("Se realizaron los cambios correctamente."):showError(n.message)})});